import React from "react";
import "./style.css";

const employees = []

function EmployeeTable() {
  return (
    <table>
      <thread>
        <tr>
          <th>Image</th>
          <th>Name</th>
          <th>Phone</th>
          <th>Email</th>
          <th>DOB</th>
        </tr>
        {employees.map(person => (
          <tr>
            <th>Image</th>
            <th>Name</th>
            <th>Phone</th>
            <th>Email</th>
            <th>DOB</th>
          </tr> 
        ))}
      </thread>
    </table>
  );
}

export default EmployeeTable;
